import React, { Component } from 'react';
import { observer, inject } from 'mobx-react';

@inject('pos')
@observer
class Mask extends Component {
  render() {
    const { pos } = this.props;
    return (
      <div>
        <h1>{pos.mylat}, {pos.mylng}</h1>
        <button onClick={pos.getPosition2}>현재위치 가져오기</button>
      </div>
    );
  }
}

export default Mask;
